  true,\n\t\"url\": null,\n\t\"notes\": \"The 2001 National Survey of Veterans (NSV)
  is the fifth in a series of comprehensivernnationwide surveys designed to help the
  Department of Veterans Affairs (VA) plan its future programsrnand services for veterans.
  The information gathered through these surveys will help VA to identify thernneeds
  of veterans and then allocate resources in ways that will ensure these needs can
  be met. It also provides a snapshot profile of the veteranrnpopulation. Data collected
  through the NSV enables VA to: follow changing trends in the veteranrnpopulation;
  compare characteristics of veterans who use VA services with those of veterans who
  do not;rnstudy VAu00efu00bfu00bds role in the delivery of all benefits that veterans
  receive; and update information about veteransrnto help the Department develop its
  policies.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
